rows.measure:
Pentru denumirea comună internațională -TEMOZOLOMIDUM în prezent se comercializează
următoarele medicamente, care, conform raportărilor primite de ANMDM referitoare la
stocurile la data de 31.01.2017 se aflau în stoc la distribuitori angro, după cum
urmează:
TEMODAL 100 mg, CAPS. - trei distribuitori angro;
TEMODAL 140mg și 20 mg, CAPS.- doi distribuitori angro;
TEMOZOLOMIDE TEVA 100 mg , CAPS. - doi distribuitori angro;
TEMOZOLOMIDE TEVA 20 mg și 250 mg, CAPS. - trei distribuitori angro;
BRASTORYN 100 mg, 140 mg, 20 mg CAPS. - un ditribuitor angro.
